import React from 'react'


const Skills = (props) => {

    const [SKILL_LIST] = props;
    return (
        <div>
          {SKILL_LIST.map((skill) => (
            <div key={skill.name}>{skill.name}</div>
          ))}
        </div>
      );
}

export default Skills
